import logo from "./logo.svg";
import "./App.css";
import data from "./users.json";

function App() {
  return (
    <div>
      {data.map((data) => {
        return (
        <div className="box">
          {data.first_name}
        </div>
        );
      })}
    </div>
  );
}

export default App;
